const Input = () =>{
    let [email, setEmail] = useState("");


    const HandleSubmit = {
        preventDefault()
        {document.getElementById('root')}

    }
    return(
        <form onSubmit={HandleSubmit}>
            <input value={email} type="email" onChange={(e) => setEmail(e.target.value) }/>


        </form>




    );
}
export default Input;
